import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './css/ThankYou.css';

const ThankYou = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { 
    orderId, 
    cartGrandTotal, 
    cartItems, 
    checkoutDetails, 
    discountApplied, 
    pointsRedeemed, 
    amountSavedAgainstMRP,
    groupedItems,
    paymentMethod,
    amountReturned
  } = location.state || { 
    orderId: 'N/A', 
    cartGrandTotal: 0, 
    cartItems: [], 
    checkoutDetails: {}, 
    discountApplied: 0, 
    pointsRedeemed: 0, 
    amountSavedAgainstMRP: 0,
    groupedItems: [],
    paymentMethod: 'N/A',
    amountReturned: 0
  };

  const handleNewOrder = () => {
    navigate('/poscart');
  };

  // Calculate total items and total quantity
  const totalItems = cartItems.length;
  const totalQuantity = cartItems.reduce((sum, item) => sum + item.quantity, 0);

  // For demonstration, let's assume current date for order date
  const orderDate = new Date().toLocaleDateString();

  return (
    <div className="thank-you-container">
      <div className="receipt-box">
        <h2 className="tax-invoice-title">TAX INVOICE</h2>
        <div className="invoice-details">
          <p>Order no: <strong>{orderId}</strong></p>
          <p>Order Date: <strong>{orderDate}</strong></p>
          <p>Store: <strong>{checkoutDetails.store || 'N/A'}</strong></p>
          <p>Cashier: <strong>{checkoutDetails.cashier || 'N/A'}</strong></p>
        </div>

        <h3 className="product-list-title">Product List</h3>
        <table className="product-list-table">
          <thead>
            <tr>
              <th>SKU</th>
              <th>Product Name</th>
              <th>Qty</th>
              <th>N/Rate</th>
              <th>Value</th>
            </tr>
          </thead>
          <tbody>
            {cartItems.map((item, index) => (
              <tr key={index}>
                <td>{item.sku_id || 'N/A'}</td>
                <td>{item.productName}</td>
                <td>{item.quantity}</td>
                <td>{item.market_rate ? item.market_rate.toFixed(2) : 'N/A'}</td>
                <td>{(item.quantity * item.price).toFixed(2)}</td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Remaining sections will be added here */}

        <div className="thank-you-actions">
          <button className="action-button" onClick={handleNewOrder}>New Order</button>
          <button className="action-button">Print Bill</button>
          <button className="action-button">Bill Send to Email</button>
          <button className="action-button">Send to Whatsapp</button>
          <button className="action-button">Invoice</button>
          <button className="action-button">Share Bill</button>
        </div>
        <button className="action-button open-cash-register-button">Open Cash Register</button>
      </div>
    </div>
  );
};

export default ThankYou;
